css:
:root {
  font-size: 16px;
}
.script-runner {
  background: #fff;
  padding: 0px 20px;
  padding-bottom: 20px;
  overflow-y: scroll;
}
.script-runner pre {
  background-color: #f0f0f0;
  border: 1px solid #cccbba;
  line-height: normal;
}
.script-runner pre .stdout {
  color: black;
}
.script-runner pre .stderr {
  color: red;
}
.script-runner .footer,
.script-runner .header {
  margin: 8px 10px;
  color: #333;
}
